{"Q0":"Die "angenehmen" Bilder waren entweder von eckigen Strukturen umhüllt oder bestanden nur aus quadratischen Strukturen.
Die "unangenehmen" Bilder liefen sehr spitz zu und selbst wenn eckige Strukturen vorhanden gewesen sind, so schien es als würden diese von den spitzen Strukturen angegriffen werden, was negativ gewichtet ist.

Aggressive Zeichen schienen negativ besetzt zu sein, während schöne und einfache Strukturen positiv besetzt gewesen sind."}
